Vero Group специализируется на производстве строительных материалов.

В состав холдинга входят более 10 компаний, которые занимаются производством различных строительных материалов. В наш ассортимент на сегодняшний день входят продукции:

1. Пластиковые Трубы и фитинги;
2. Саморезы;
3. Гипсокартон;
4. Скотч;
5. Алюминиевые композитные панели;
6. Бесцветный лак;
7. МДФ панели;
8. Резина;
9. Производство гофра коробок;
10. Потолочный пластик и аксессуары
и другие продукции.

Группа компаний «Vero Group» непрерывно растет, расширяет ассортимент и повышает уровень обслуживания. Компания в производстве использует современное оборудование и регулярно вденряет новые, более продвинутые технологии.

Производством пластиковых труб и фитингов занимается СП ООО ‘’MASTER BILDING PRODUCTS’’, которая выпускает продукции под торговой маркой ‘’VERO’’. Компания основана в 2015 году, по сегодняшний день расширяет линейку производимой продукции.

Продукция производится только из качественного сырья по турецким технологиям и в соответствие с международными требованиями ГОСТ 32415-2013. Имеются все необходимые сертификаты а также международные сертификаты ISO.
